import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { handleError, handleSuccess } from '../../../../utils/utils';
import { ToastContainer } from 'react-toastify';
import styles from './PendingOrders.module.css';
import Navbar from '../../../../components/navbar/Navbar';
import Footer from '../../../../components/footer/Footer';

function PendingOrders() {
    const [dataCementOrder, setDataCementOrder] = useState([]);

    const navigate = useNavigate();

    const handleLogout = (e) => {
        localStorage.removeItem('token');
        localStorage.removeItem('role');
        handleSuccess('User Loggedout');
        setTimeout(() => {
            navigate('/company-login');
        }, 500)
    }

    useEffect(() => {
        const fetchDataCementOrder = async () => {
            try {
                const url = `http://localhost:8080/auth/company/order-data`;
                const headers = {
                    headers: {
                        // ?status=pending
                        'Authorization': localStorage.getItem('token'),
                    }
                }
                const response = await fetch(url, headers,);
                const result = await response.json();
                setDataCementOrder(result);
            } catch (err) {
                handleError(err);
            }
        }
        fetchDataCementOrder();
    }, []);

    return(
        <section className={styles.PendingOrdersBody}>
            <Navbar 
                one="Home"
                pathOne="/company/home"
                two="Orders"
                two1="Under preparing orders"
                pathTwo1="/company/home/under-preparing-orders"
                two2="Pending orders"
                pathTwo2="/company/home/pending-orders"
                two3="Old orders"
                pathTwo3="/company/home/old-orders"
                three="Cement"
                pathThree="/company/home/cement-order"
                four="Concrete"
                pathFour="/company/home/concrete-order"
                five="Profile"
                pathFive="/company/home/profile"
                logout={handleLogout}
            />

            
            <div className={styles.pendingOrdersTitle}>
                <h2 className={styles.pendingOrdersH2}>Pending Orders</h2>
            </div>
            <div className={styles.pendingOrdersContainer}>
    {dataCementOrder && dataCementOrder.length > 0 ? (
        dataCementOrder.map((order, index) => {
            const orderData = order._doc; // Access the actual data from _doc
            return (
                <div className={styles.pendingOrdersRow} key={orderData._id || index}> {/* Use a unique key */}
                    <div>
                        {console.log(orderData)} {/* Debugging */}
                        <p className={`${styles.pendingOrdersData} ${styles.pendingOrdersSupplierName}`}>
                            {/* <strong>Supplier name:</strong> {orderData. supplierName || 'N/A'} */}
                        </p>
                    </div>
                    <div className={styles.pendingOrdersDiv}>
                        <p className={styles.pendingOrdersData}>
                            <strong>Company name:</strong> {orderData.companyName || 'N/A'}
                        </p>
                        <p className={styles.pendingOrdersData}>
                            <strong>Company phone:</strong> {orderData.companyPhone || 'N/A'}
                        </p>
                        <p className={styles.pendingOrdersData}>
                            <strong>Recipient's name:</strong> {orderData.recipientName || 'N/A'}
                        </p>
                        <p className={styles.pendingOrdersData}>
                            <strong>Recipient's phone:</strong> {orderData.recipientPhone || 'N/A'}
                        </p>
                        <p className={styles.pendingOrdersData}>
                            <strong>Delivery time:</strong> {orderData.deliveryTime || 'N/A'}
                        </p>
                        <p className={styles.pendingOrdersData}>
                            <strong>Location:</strong> {orderData.location || 'N/A'}
                        </p>
                    </div>
                    <div className={styles.pendingOrdersDiv}>
                        <p className={styles.pendingOrdersData}>
                            <strong>Cement quantity:</strong> {orderData.cementQuantity || 'N/A'} ton
                        </p>
                        <p className={styles.pendingOrdersData}>
                            <strong>Number of cement bags:</strong> {orderData.cementNumberBags || 'N/A'}
                        </p>
                        <p className={styles.pendingOrdersData}>
                            <strong>Cement price:</strong> {orderData.price || 'N/A'} JD
                        </p>
                        <p className={styles.pendingOrdersData}>
                            <strong>Order request time:</strong> {orderData.orderRequestTime || 'N/A'}
                        </p>
                    </div>
                </div>
            );
        })
    ) : (
        <p>No pending orders available.</p>
    )}
    </div>


            <Footer 
                one="Home"
                pathOne="/company/home"
                two="Orders"
                two1="Under preparing orders"
                pathTwo1="/company/home/under-preparing-orders"
                two2="Pending orders"
                pathTwo2="/company/home/pending-orders"
                two3="Old orders"
                pathTwo3="/company/home/old-orders"
                three="Cement"
                pathThree="/company/home/cement-order"
                four="Concrete"
                pathFour="/company/home/concrete-order"
                five="Profile"
                pathFive="/company/home/profile"
                logout={handleLogout}
            />
            <ToastContainer />
        </section>
    );
}

export { PendingOrders };
